import React from "react";

import styled from "styled-components";
import MyImgSlider from "./MyImgSlider";
const ImgSlider = () => {
  return (
    <div>
      <Container>

        <Slide>
            <MyImgSlider/>
        </Slide>
      </Container>
    </div>
  );
};
const Container = styled.div`
  width: 100%;
  max-width: 1280px;
  margin: 0 auto;
  text-align: center;
  border: 2px  solid green;
`;

const Slide = styled.div``;

export default ImgSlider;
